#include <string>
#include <regex>
#include <vector>
#include <sstream>
#include <algorithm>
#include <map>
#include <iostream>

std::string markdown_to_html(const std::string& markdown)
{
    // Define a map of markdown to html tags
    std::map<std::string, std::string> markdown_tags =
    {
        {"#", "<h1>"},
        {"##", "<h2>"},
        {"###", "<h3>"},
        {"####", "<h4>"},
        {"#####", "<h5>"},
        {"######", "<h6>"},
        {"[]()", "<a href=\"\" target=\"\_blank\">"},
        {"[]()<br>", "</a>"},
        {"\\*", "<strong>"},
        {"_", "<em>"},
        {"[link text](link) ", "<a href=\"link\">link text</a>" }
    };

    // Use a regular expression to find all occurrences of markdown tags
    std::regex markdown_regex("(?<!\\\\)(^#+|^\\*|_)|(\\[.*?\\]|\\[.*?\\]\\s.*?)");
    std::smatch markdown_match;

    std::string html_output;
    std::stringstream ss(markdown);
    std::string line;
    while (std::getline(ss, line))
    {
        std::regex_search(line, markdown_match, markdown_regex);
        for (const auto& match : markdown_match)
        {
            std::string tag = match.str();
            if (markdown_tags.count(tag) > 0)
            {
                html_output += markdown_tags[tag];
                html_output += match.suffix().str();
            }
            else
            {
                html_output += markdown_match[0];
            }
        }
    }

    return html_output;
}
